// export default Sidebar;
import { useNavigate } from 'react-router-dom';

const Sidebar = () => {
  const navigate = useNavigate();

  const groups = [
    { id: 'my-notes', name: 'My Notes', initials: 'MN' },
    { id: 'css', name: 'CSS Notes', initials: 'CN' },
    { id: 'html', name: 'HTML grp', initials: 'HG' },
    // Add other groups...
  ];

  return (
    <div className="bg-white h-full w-[300px]">
      <h2 className="text-xl font-bold p-4">Pocket Notes</h2>
      <ul>
        {groups.map((group) => (
          <li
            key={group.id}
            onClick={() => navigate(`/pocketNotes/${group.id}`)}
            className="cursor-pointer hover:bg-gray-100 px-4 py-2 flex items-center gap-2"
          >
            <div className="w-10 h-10 rounded-full bg-blue-500 text-white flex items-center justify-center">
              {group.initials}
            </div>
            <span>{group.name}</span>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Sidebar;
